import Menu from "../Menu";

import { Conteudo, Container, AgendarHorario, CompartilheLink, HorariosMarcados } from "./styles";

export default function Home() {

  return (
    <Container>
      <Menu></Menu>
      <Conteudo>
        <div>
          <AgendarHorario>
            <label>Agendar Horário</label>
          </AgendarHorario>
          <CompartilheLink>
            <label>Compartilhe o link com seus clientes</label>
            <input type="text" />
          </CompartilheLink>
        </div>
        <HorariosMarcados>Horários Marcados</HorariosMarcados>
      </Conteudo>
    </Container>
  );
}
